--
-- PostgreSQL database import Aquo biotaxon
--

SET statement_timeout = 0;
SET lock_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;

SET search_path = public, pg_catalog;

CREATE TABLE taxon_animalia (
    aphiaid integer NOT NULL,
    scientificname character varying(255),
    authority character varying(255),
    status character varying(255),
    aphiaid_accepted integer,
    kingdom character varying(255),
    phylum character varying(255),
    class character varying(255),
    "order" character varying(255),
    family character varying(255),
    genus character varying(255),
    subgenus character varying(255),
    species character varying(255),
    subspecies character varying(255),
    alt_id integer,
    alt_code character varying(50),
    standard character varying(50),
    referencelink character varying(255),
    localname character varying(255),
    iddonar character varying(50),
    donarname character varying(255),
    source character varying(50)
)
INHERITS (taxon);

COMMENT ON TABLE  taxon_animalia IS 'Animals not found in WoRMS database';
COMMENT ON COLUMN taxon_animalia.status IS 'mapping van statuscode uit Aquo Biotaxon.';
COMMENT ON COLUMN taxon_animalia.source IS 'Geeft de bron aan van de data.';

ALTER TABLE ONLY taxon_animalia ALTER COLUMN idtaxon SET DEFAULT nextval('taxon_idtaxon_seq'::regclass);



